import React from "react";
import { Link } from "react-router-dom";
export default class Index extends React.Component {
  render() {
    return (
      <div>
        <h1>第一个页面</h1>
        <li>
          <Link to="/view2">跳转到第二个页面</Link>
        </li>
      </div>
    );
  }
}
